import React, {useState, useEffect}from "react";
import axios from "axios";

const baseURL = "http://localhost:7000/userData/";
// const baseURL = "https://jsonplaceholder.typicode.com/posts/1/comments";

export default function App() {
  const [previous, setNew] = React.useState([]);

  React.useEffect(() => {
    axios.get(baseURL)
    .then((response) => {
      setNew(response.data);
    });
  }, []);



  if (!previous) return null;

  console.log(JSON.stringify(previous));
  return (
    <div>
      <h1>Doctor Data to be render</h1>

      {previous.map((pre) => (
        <ul>
          <li key={pre.id}>{pre.name}</li>
          <li key={pre.id}>{pre.age}</li>
          <li key={pre.id}>{pre.gender}</li>
          <li key={pre.id}>{pre.location}</li>
          <li key={pre.id}>{pre.phoneNo}</li>
        </ul>
      ))}

    </div>
  );
}
